Tabell 1 viser det samme som "Figur 1", men her kan man lettere se hvor mange tester hver enkelt deltaker har gjennomf√∏rt og hvilket resultat som h√∏rer til hvilken test.

### Tabellen eg skal bruke 




::: {.cell}

```{.r .cell-code}
library(dplyr)
library(tidyr)
library(gt)

# Reshape data and calculate differences between timepoints
dat_wide <- dat %>%
  select(id, timepoint, vo2.max) %>%
  pivot_wider(names_from = timepoint, values_from = vo2.max) %>%
  mutate(Diff_T2_T1 = `t2` - `t1`,
         Diff_T4_T3 = `t4` - `t3`) 

# Create summary table with n for each timepoint
n_summary <- dat %>%
  group_by(timepoint) %>%
  summarise(n = n())

# Generate table with gt
dat_wide %>%
  gt() %>%
  tab_header(
    title = "VO2max per Participant per Timepoint"
  ) %>%
  cols_label(
    id = "Participant ID",
    `t1` = "Test 1",
    `t2` = "Test 2",
    `t3` = "Test 3",
    `t4` = "Test 4",
    Diff_T2_T1 = "Difference (T2 - T1)",
    Diff_T4_T3 = "Difference (T4 - T3)"
  ) %>%
  fmt_number(
    columns = everything(),
    decimals = 2
  ) %>%
  tab_footnote(
    footnote = paste("Sample sizes: t1 = ", n_summary$n[1], 
                     ", t2 = ", n_summary$n[2], 
                     ", t3 = ", n_summary$n[3], 
                     ", t4 = ", n_summary$n[4])
  )
```

